import React from "react";
import {Image, Popup, Rating, Button} from 'semantic-ui-react';

function element(props){
    console.log(props);
    let src='../img/elements/';
    return(
        
        <div id="element">
            <Popup
                trigger={<Image  src={src + props.data.img} size="tiny"></Image>}
                on='click'
                hideOnScroll>
                <Popup.Content>
                        <span>
                        <h3>{props.data.name}</h3>
                        <p>{props.data.text}</p>
                        <Rating defaultRating={props.data.rate} maxRating={5} disabled />
                        <Button size="small">hh</Button>
                        </span>
                </Popup.Content>
            </Popup>
        </div>
    )
}


export default element;
